    const [onSelect,setOnSelect] = useState()

    return (
        <ul>

            <div id='list-sidebar'>
            <h2>Lists</h2>
            <NavLink to={`/today`} activeClassName="active-link" className='link'>today</NavLink>
            {   
                lists.map((l) => 
                    <NavLink to={`/todo-list/${l.id}`} key={l.id} activeClassName="active-link" className='link'>{l.title} </NavLink>
                )
            }
        </div>        
        </ul>
    )
}
